INSERT INTO `nic_article` VALUES ('5', null, null, '填表通知', null, '每个月13号之前请大家给组长交一份纸质版反馈表 个人只填写第一栏 \r\n剩下的由各自负责老师填写 对学生勤工助学情况做出评价 如果两次被评为C或有一次被评为D 取消勤工助学资格 请大家认真干好自己的本职工作', '注:反馈表跟工资直接挂钩 每月每人一张 谢谢配合\r\n', null, null);
